// PortalServiceServer is the server API for PortalService service.
// All implementations must embed UnimplementedPortalServiceServer
// for forward compatibility.
type PortalServiceServer interface {
	// -----------------------系统平台表-----------------------
	// 基础CRUD操作
	PlatformAdd(context.Context, *AddSysPlatformReq) (*AddSysPlatformResp, error)
	PlatformUpdate(context.Context, *UpdateSysPlatformReq) (*UpdateSysPlatformResp, error)
	PlatformDel(context.Context, *DelSysPlatformReq) (*DelSysPlatformResp, error)
	PlatformGetById(context.Context, *GetSysPlatformByIdReq) (*GetSysPlatformByIdResp, error)
	PlatformSearch(context.Context, *SearchSysPlatformReq) (*SearchSysPlatformResp, error)
	// 快捷操作
	PlatformEnable(context.Context, *EnableSysPlatformReq) (*EnableSysPlatformResp, error)
	PlatformDisable(context.Context, *DisableSysPlatformReq) (*DisableSysPlatformResp, error)
	PlatformSetDefault(context.Context, *SetDefaultSysPlatformReq) (*SetDefaultSysPlatformResp, error)
	PlatformUnsetDefault(context.Context, *UnsetDefaultSysPlatformReq) (*UnsetDefaultSysPlatformResp, error)
	PlatformGetDefault(context.Context, *GetDefaultSysPlatformReq) (*GetDefaultSysPlatformResp, error)
	PlatformGetAllEnabled(context.Context, *GetAllEnabledPlatformsReq) (*GetAllEnabledPlatformsResp, error)
	// -----------------------用户平台权限表-----------------------
	// 用户平台绑定操作
	UserPlatformBind(context.Context, *BindUserPlatformReq) (*BindUserPlatformResp, error)
	UserPlatformUnbind(context.Context, *UnbindUserPlatformReq) (*UnbindUserPlatformResp, error)
	UserPlatformGet(context.Context, *GetUserPlatformsReq) (*GetUserPlatformsResp, error)
	PlatformUsersGet(context.Context, *GetPlatformUsersReq) (*GetPlatformUsersResp, error)
	// -----------------------系统API权限表-----------------------
	APIAdd(context.Context, *AddSysAPIReq) (*AddSysAPIResp, error)
	APIUpdate(context.Context, *UpdateSysAPIReq) (*UpdateSysAPIResp, error)
	APIDel(context.Context, *DelSysAPIReq) (*DelSysAPIResp, error)
	APIGetById(context.Context, *GetSysAPIByIdReq) (*GetSysAPIByIdResp, error)
	APISearch(context.Context, *SearchSysAPIReq) (*SearchSysAPIResp, error)
	// 获取所有分组树状数据(仅包含id,name,pid，平铺形式)
	APIGetGroupsTree(context.Context, *GetGroupsTreeReq) (*GetGroupsTreeResp, error)
	APIGetTree(context.Context, *GetSysAPITreeReq) (*GetSysAPITreeResp, error)
	// -----------------------部门表-----------------------
	DeptAdd(context.Context, *AddSysDeptReq) (*AddSysDeptResp, error)
	DeptUpdate(context.Context, *UpdateSysDeptReq) (*UpdateSysDeptResp, error)
	DeptDel(context.Context, *DelSysDeptReq) (*DelSysDeptResp, error)
	DeptGetById(context.Context, *GetSysDeptByIdReq) (*GetSysDeptByIdResp, error)
	DeptSearch(context.Context, *SearchSysDeptReq) (*SearchSysDeptResp, error)
	// 根据 父id 查询 下一级 部门
	DeptGetNextLevel(context.Context, *SearchSysDeptByParentIdReq) (*SearchSysDeptByParentIdResp, error)
	// 查询所有父级 部门
	DeptGetAllParent(context.Context, *GetAllParentDeptReq) (*GetAllParentDeptResp, error)
	// -----------------------登录日志表-----------------------
	LoginLogDel(context.Context, *DelSysLoginLogReq) (*DelSysLoginLogResp, error)
	LoginLogSearch(context.Context, *SearchSysLoginLogReq) (*SearchSysLoginLogResp, error)
	// -----------------------角色表-----------------------
	RoleAdd(context.Context, *AddSysRoleReq) (*AddSysRoleResp, error)
	RoleUpdate(context.Context, *UpdateSysRoleReq) (*UpdateSysRoleResp, error)
	RoleDel(context.Context, *DelSysRoleReq) (*DelSysRoleResp, error)
	RoleGetById(context.Context, *GetSysRoleByIdReq) (*GetSysRoleByIdResp, error)
	RoleSearch(context.Context, *SearchSysRoleReq) (*SearchSysRoleResp, error)
	// 角色菜单关联方法
	RoleAddMenu(context.Context, *AddSysRoleMenuReq) (*AddSysRoleMenuResp, error)
	// 查询关联了哪些菜单
	RoleSearchMenu(context.Context, *SearchSysRoleMenuReq) (*SearchSysRoleMenuResp, error)
	// 角色 api权限关联方法
	RoleAddApi(context.Context, *AddSysRoleApiReq) (*AddSysRoleApiResp, error)
	// 查询关联了哪些 api权限
	RoleSearchApi(context.Context, *SearchSysRoleApiReq) (*SearchSysRoleApiResp, error)
	// -----------------------API Token表-----------------------
	TokenAdd(context.Context, *AddSysTokenReq) (*AddSysTokenResp, error)
	TokenDel(context.Context, *DelSysTokenReq) (*DelSysTokenResp, error)
	TokenGetById(context.Context, *GetSysTokenByIdReq) (*GetSysTokenByIdResp, error)
	TokenSearch(context.Context, *SearchSysTokenReq) (*SearchSysTokenResp, error)
	// 获取某个用户token 方法
	TokenGetByUserId(context.Context, *GetSysTokenByUserIdReq) (*GetSysTokenByUserIdResp, error)
	// -----------------------用户表-----------------------
	UserAdd(context.Context, *AddSysUserReq) (*AddSysUserResp, error)
	UserUpdate(context.Context, *UpdateSysUserReq) (*UpdateSysUserResp, error)
	UserDel(context.Context, *DelSysUserReq) (*DelSysUserResp, error)
	UserGetById(context.Context, *GetSysUserByIdReq) (*GetSysUserByIdResp, error)
	UserSearch(context.Context, *SearchSysUserReq) (*SearchSysUserResp, error)
	// 通过用户ID 查询用户角色列表
	UserSearchRole(context.Context, *SearchSysUserRoleReq) (*SearchSysUserRoleResp, error)
	// 个人修改信息
	UserUpdateInfo(context.Context, *UpdateSysUserInfoReq) (*UpdateSysUserInfoResp, error)
	// 修改头像
	UserUpdateAvatar(context.Context, *UpdateSysUserAvatarReq) (*UpdateSysUserAvatarResp, error)
	// 修改密码
	UserUpdatePwd(context.Context, *UpdateSysUserPwdReq) (*UpdateSysUserPwdResp, error)
	// 禁用或启用用户
	UserUpdateStatus(context.Context, *UpdateSysUserStatusReq) (*UpdateSysUserStatusResp, error)
	// 用户绑定角色
	UserUpdateBindRole(context.Context, *UpdateSysUserBindRoleReq) (*UpdateSysUserBindRoleResp, error)
	// 用户个人详情
	UserGetInfo(context.Context, *GetSysUserInfoReq) (*GetSysUserInfoResp, error)
	// 重置密码
	UserResetPwd(context.Context, *ResetSysUserPwdReq) (*ResetSysUserPwdResp, error)
	// -----------------------系统菜单表-----------------------
	// 基础CRUD操作
	MenuAdd(context.Context, *AddSysMenuReq) (*AddSysMenuResp, error)
	MenuUpdate(context.Context, *UpdateSysMenuReq) (*UpdateSysMenuResp, error)
	MenuDel(context.Context, *DelSysMenuReq) (*DelSysMenuResp, error)
	MenuGetById(context.Context, *GetSysMenuByIdReq) (*GetSysMenuByIdResp, error)
	// 搜索和列表操作
	MenuSearch(context.Context, *SearchSysMenuReq) (*SearchSysMenuResp, error)
	MenuGetList(context.Context, *GetSysMenuListReq) (*GetSysMenuListResp, error)
	// 树状结构操作
	// 根据角色id组 获取菜单树 注意去重
	MenuGetRolesMenuTree(context.Context, *GetRolesMenuTreeReq) (*GetRolesMenuTreeResp, error)
	MenuGetAllMenuTree(context.Context, *GetAllMenuTreeReq) (*GetAllMenuTreeResp, error)
	MenuGetSimpleTree(context.Context, *GetSysMenuSimpleTreeReq) (*GetSysMenuSimpleTreeResp, error)
	// 获取平台地址
	GetKubeNovaPlatformUrl(context.Context, *GetPlatformUrlReq) (*GetPlatformUrlResp, error)
	mustEmbedUnimplementedPortalServiceServer()
}

